// src/Pages/User/UserHeader.js

import React from "react";
import { useNavigate } from "react-router-dom";
import "./UserDashboard.css"; // using your same CSS
import { FaSignOutAlt } from "react-icons/fa";

const UserOutlet = () => {
  const navigate = useNavigate();
  const user = localStorage.getItem("userName");

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };

  return (
    <header className="dashboard-header">
      <h2>Welcome, {user ? user : ""}</h2>

      <nav>
        <button onClick={() => navigate("/SubmitFeedback")}>
          Submit New Feedback
        </button>

        <button onClick={() => navigate("/ViewStatus")}>
          View Status
        </button>

        <button onClick={() => navigate("/SubmittedFeedbacks")}>
          Submitted Feedbacks
        </button>
      </nav>

      <button onClick={handleLogout} className="logout-btn">
        <FaSignOutAlt /> Logout
      </button>
    </header>
  );
};

export default UserOu;
